def calculate_max_mex(S, K):
    S.sort()
    r = 1
    x = 0
    flag = 0
    if S[0] != 0:
        if K >= S[0]:
            K -= S[0]
        else:
            flag = 1
            r = K
    if flag == 0:
        for j in range(len(S) - 1):
            if S[j + 1] - S[j] > 1:
                if K >= S[j + 1] - S[j] - 1:
                    K -= S[j + 1] - S[j] - 1
                    x = j
                else:
                    x = j
                    break
            x = j
            if j == len(S) - 2:
                x += 1
        r = S[x] + K + 1
    return r

